Episode Title: &quot;Dog Trainer Scam?; Electrocuted Godson&quot;
Episode Order: Season 18, Episode 118
Original Air Date: January 24, 2014

&quot;Owners of a German shepherd and a Rottweiler say an obedience trainer scammed them; a woman sues her godson for repayment of a loan for medical bills after he was electrocuted on the job.&quot;

Seed and enjoy!
